import React from 'react';
import { View, Text, StyleSheet, ScrollView, TouchableOpacity, Image } from 'react-native';
import { useRouter } from 'expo-router';
import { useTheme } from '@/context/ThemeContext';
import { useLanguage } from '@/context/LanguageContext';
import { useDiagnosis } from '@/context/DiagnosisContext';
import { ArrowRight, Activity, TriangleAlert as AlertTriangle } from 'lucide-react-native';
import { COLORS } from '@/constants/Colors';
import { HomeHeader } from '@/components/HomeHeader';
import { StatusCard } from '@/components/StatusCard';
import Animated, { FadeInDown } from 'react-native-reanimated';

export default function HomeScreen() {
  const router = useRouter();
  const { theme } = useTheme();
  const { t } = useLanguage();
  const { diagnosisHistory } = useDiagnosis();
  
  const isDark = theme === 'dark';
  const backgroundColor = isDark ? '#1A1A1A' : COLORS.background;
  const textColor = isDark ? '#EFEFEF' : COLORS.text;
  const cardBackground = isDark ? '#2A2A2A' : '#FFFFFF';

  const quickActions = [
    { 
      title: t('home.newDiagnosis'), 
      icon: <Activity size={24} color={COLORS.primary} />,
      route: '/diagnosis' 
    },
    { 
      title: t('home.healthTips'), 
      icon: <AlertTriangle size={24} color={COLORS.accent} />,
      route: '/health-tips' 
    },
  ];

  const recentDiagnoses = diagnosisHistory.slice(0, 2);

  return (
    <View style={[styles.container, { backgroundColor }]}>
      <HomeHeader />
      
      <ScrollView 
        style={styles.scrollView}
        showsVerticalScrollIndicator={false}
      >
        <Animated.View entering={FadeInDown.delay(200).duration(500)}>
          <Text style={[styles.welcomeText, { color: textColor }]}>
            {t('home.welcome')}
          </Text>
          
          <StatusCard />
          
          <View style={styles.sectionContainer}>
            <Text style={[styles.sectionTitle, { color: textColor }]}>
              {t('home.quickActions')}
            </Text>
            
            <View style={styles.quickActionsContainer}>
              {quickActions.map((action, index) => (
                <TouchableOpacity 
                  key={index}
                  style={[styles.actionCard, { backgroundColor: cardBackground }]}
                  onPress={() => router.push(action.route)}
                >
                  <View style={styles.actionIcon}>
                    {action.icon}
                  </View>
                  <Text style={[styles.actionTitle, { color: textColor }]}>
                    {action.title}
                  </Text>
                  <ArrowRight size={16} color={isDark ? '#777' : '#999'} />
                </TouchableOpacity>
              ))}
            </View>
          </View>
          
          <View style={styles.sectionContainer}>
            <View style={styles.sectionHeader}>
              <Text style={[styles.sectionTitle, { color: textColor }]}>
                {t('home.recentDiagnoses')}
              </Text>
              <TouchableOpacity onPress={() => router.push('/diagnosis-history')}>
                <Text style={styles.viewAll}>{t('home.viewAll')}</Text>
              </TouchableOpacity>
            </View>
            
            {recentDiagnoses.length > 0 ? (
              recentDiagnoses.map((diagnosis, index) => (
                <TouchableOpacity 
                  key={index}
                  style={[styles.diagnosisCard, { backgroundColor: cardBackground }]}
                  onPress={() => router.push({
                    pathname: '/diagnosis-details',
                    params: { id: diagnosis.id }
                  })}
                >
                  <View style={styles.diagnosisContent}>
                    <Text style={[styles.diagnosisDate, { color: isDark ? '#AAAAAA' : '#666666' }]}>
                      {new Date(diagnosis.date).toLocaleDateString()}
                    </Text>
                    <Text style={[styles.diagnosisTitle, { color: textColor }]}>
                      {diagnosis.condition}
                    </Text>
                    <Text 
                      style={[styles.diagnosisSummary, { color: isDark ? '#BBBBBB' : '#444444' }]}
                      numberOfLines={2}
                    >
                      {diagnosis.summary}
                    </Text>
                  </View>
                </TouchableOpacity>
              ))
            ) : (
              <View style={[styles.emptyContainer, { backgroundColor: cardBackground }]}>
                <Text style={[styles.emptyText, { color: isDark ? '#AAAAAA' : '#666666' }]}>
                  {t('home.noDiagnoses')}
                </Text>
                <TouchableOpacity 
                  style={styles.startButton}
                  onPress={() => router.push('/diagnosis')}
                >
                  <Text style={styles.startButtonText}>
                    {t('home.startDiagnosis')}
                  </Text>
                </TouchableOpacity>
              </View>
            )}
          </View>
          
          <View style={styles.sectionContainer}>
            <Text style={[styles.sectionTitle, { color: textColor }]}>
              {t('home.healthArticle')}
            </Text>
            <TouchableOpacity 
              style={[styles.articleCard, { backgroundColor: cardBackground }]}
              onPress={() => router.push('/health-article')}
            >
              <Image
                source={{ uri: 'data:image/jpeg;base64,' }}
                style={styles.articleImage}
                resizeMode="cover"
              />
              <View style={styles.articleContent}>
                <Text style={[styles.articleTitle, { color: textColor }]}>
                  {t('home.articleTitle')}
                </Text>
                <Text 
                  style={[styles.articleSummary, { color: isDark ? '#BBBBBB' : '#444444' }]}
                  numberOfLines={2}
                >
                  {t('home.articleSummary')}
                </Text>
                <Text style={styles.readMore}>{t('home.readMore')}</Text>
              </View>
            </TouchableOpacity>
          </View>
        </Animated.View>
      </ScrollView>
    </View>
  );
}

